description:
Starting From ... Now! is an online drama that explores the lives of four inner-Sydney lesbians as they struggle to work out who they are, find a place where they belong, and maybe even find someone to love along the way. Set in Sydney, Australia, Starting From ... Now! stars Bianca Bradey, Sarah de Possesse, Rosie Lourde, and Lauren Orrell and was created and directed by award winning filmmaker and writer, Julie Kalceff.
